import { useState,useEffect } from "react";
import './styles/Login.css';

function CreateUser() {
    var user = {
        email: document.getElementById("email-field").value,
        password: document.getElementById("password-field").value,
        name: document.getElementById("name-field").value,
        lastname: document.getElementById("lastname-field").value,
        documentation: document.getElementById("documentation-field").value,
    }
    console.log(user)

    // POST request to create an user

    fetch("localhost:8080/Register", {
    method: "POST",
    body: JSON.stringify(user),
    headers: {
        "Content-type": "application/json; charset=UTF-8"
    }
    })
    .then((response) =>{
        if (response.ok) {
            alert("Usuario creado con exito")
        }
    })
}

function Register() {
    return (
        <div>
            <form className="register-form">
                <input id="email-field" placeholder="Email" type="email"></input>
                <input id="password-field" placeholder="ContraseÃ±a" type="password"></input>
                <input id="name-field" placeholder="Nombre"></input>
                <input id="lastname-field" placeholder="Apellido"></input>
                <input id="documentation-field" placeholder="DNI"></input>
                <button type="button" onClick={CreateUser}>Crear Cuenta</button>
            </form>
        </div>
    )
}

export default Register;
